import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const handleClick = (event: React.MouseEvent<HTMLDivElement, MouseEvent>) => {
    console.log(event.target);
    console.log(event.currentTarget);
  };

  const handleRightClick = (event: React.MouseEvent<HTMLDivElement, MouseEvent>) => {
    event.preventDefault();
    console.log("Right Click", event.pageX, event.pageY);
  }

  return (
    <div className="App">
      <header className="App-header">
        <div>
          <p> Talent Path 1</p>
          <div>
            <div onClick={handleClick} onContextMenu={handleRightClick}>Box 1</div>
            <div onClick={handleClick} onContextMenu={handleRightClick}>Box 2</div>
            <div onClick={handleClick} onContextMenu={handleRightClick}>Box 3</div>
            <div onClick={handleClick} onContextMenu={handleRightClick}>Box 4</div>
          </div>
        </div>
        <div>
          <p> Talent Path 2</p>
          <div>
            <div onClick={handleClick} onContextMenu={handleRightClick}>Box 1</div>
            <div onClick={handleClick} onContextMenu={handleRightClick}>Box 2</div>
            <div onClick={handleClick} onContextMenu={handleRightClick}>Box 3</div>
            <div onClick={handleClick} onContextMenu={handleRightClick}>Box 4</div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
